import React, { Component } from "react";
import Hero from ".components/Hero";

function Services() {
  return (
    <div>
      <Hero backgroundImage="https://i.imgur.com/qkdpN.jpg">
        <h1>Pupster</h1>
        <h2>They're the Good Boys and Girls</h2>
      </Hero>
    </div>
  );
}

export default Services;
